  false,\n\t\"url\": null,\n\t\"notes\": \"The proposed water management program for
  1991 focuses on managing unit water levels to maintain habitat on Big Stone NWR.
  During the winter of 1990/91, cattails were again mowed in irregular patterns in
  pool 4. If sufficient, runoff is available in the spring of 1991, pool 4 will be
  allowed to rise naturally to its normal operating level of 955.0. If not, pumping
  will again be employed using pumps borrowed from the U.S. Army Corps of Engineers.
  Pool 4 will be brought up as near as possible to the 955.0 level. It is hoped that
  the 955.0 level will drown out the cattails in the mowed areas, provide productive
  edge for over-water nesting, and encourage a more productive vegetative species
  composition.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
